import './FoodHeader.scss'
import {Link } from "react-router-dom";
import { grey} from '@mui/material/colors';
import Grid from '@mui/material/Grid';

const FoodHeader=()=>{
  return(
  <div className='NavBar'>
    <Grid  justifyContent="center" container spacing={2} >
    <Link style={{'text-decoration':'none'}}  to={`/FoodList`}>
          <button><SearchIcon sx={{ color: grey[900] }} /></button>
    </Link> 
        

        <Link style={{'text-decoration':'none'}}  to={`/FoodList/FavoriteFood`}>
        <button><FavoriteBorderIcon sx={{ color: grey[900] }} /></button>
        </Link>
        
    </Grid>
  </div>
  )
}
export default FoodHeader;
